import React from 'react';

function ExpenseStatistic(props) {
    return (
        <div
        style={{ 
            display: 'flex',
            margin: '10',
            backgroundColor: "#f7dbfa",
            width: "95%",
            height: 200,
            borderRadius: 15,
        }}
        >
            <div
                style={{
                    backgroundColor: "#f7dbfa",
                }}
            >

            </div>
        </div>
    );
}

export default ExpenseStatistic;
